        public static byte[] StringToByteArray(String hex)
        {
            int NumberChars = hex.Length;
            byte[] bytes = new byte[NumberChars / 2];
            for (int i = 0; i < NumberChars; i += 2)
                bytes[i / 2] = Convert.ToByte(hex.Substring(i, 2), 16);
            return bytes;
        }


        public static object[] TokenizeText(string a)
        {
            var result = new List<object>();

            var p = 0;
            var m = RxTokenWkt.Match(a);
            while(m.Success)
            {
                var number = m.Groups["number"];
                if (!string.IsNullOrEmpty(number?.Value))
                {
                    result.Add(double.Parse(number.Value, System.Globalization.CultureInfo.InvariantCulture));
                }
                else
                {
                    result.Add(m.Groups[0].Value.Trim());
                }
                p = m.Index + m.Length;
                m = RxTokenWkt.Match(a,p,a.Length-p);
            }

            return result.ToArray();
        }

        public static bool IsWktEquivalent(string a,string b)
        {
            var tokenA = TokenizeText(a);
            var tokenB = TokenizeText(b);

            if (tokenA.Length != tokenB.Length) return false;

            for(var i=0;i<tokenA.Length;++i)
            {
                if(tokenA[i] is string && tokenB[i] is string)
                {
                    if (!((string)tokenA[i]).Equals((string)tokenB[i], StringComparison.InvariantCultureIgnoreCase)) return false;
                    continue;
                }
                if (tokenA[i] is double && tokenB[i] is double)
                {
                    if (Math.Abs(((double)tokenA[i]) - ((double)tokenB[i])) > 1e-8) return false;
                    continue;
                }

                return false;
            }

            return true;
        }

